import React, { Component } from 'react'
import { Segment } from 'semantic-ui-react'


export default class Polls extends Component {
    render() {
        return (
            <div>
                <Segment.Group raised>
                <Segment>Left</Segment>
                <Segment>Middle</Segment>
                <Segment>Right</Segment>
                </Segment.Group>
            </div>
        )
    }
}
